  "call_control.inbound_routes.did_option_detail": "Especifique el patrón DID para que coincida y pase la llamada entrante a través de esta ruta entrante. Las opciones son: <br /> · Patrones DID: agregue uno o más patrones DID. Las llamadas que coincidan con el DID definido se enrutarán al destino definido. Deje este espacio en blanco para hacer coincidir las llamadas entrantes con cualquier información DID o sin ella. <br /> · Hacer coincidir el patrón DID con las extensiones: use el comodín {{.Ext}} para hacer coincidir el número de extensión en el patrón DID. Si se selecciona esta opción, deberá configurar el Destino para esta ruta de entrada como <b> Coincidir extensiones seleccionadas </b> y seleccionar las extensiones permitidas para coincidir. P.ej. si el patrón DID es 550 {{. Ext}} y la extensión permitida es 1000, entonces las llamadas provenientes de DID 5501000 se enrutarán a la extensión 1000, y las llamadas provenientes de 5502000 no coincidirán con esta regla. <br /> · Coincidir rango DID al rango de extensión: haga coincidir el rango DID y el rango de extensión en correspondencia uno a uno. Si se selecciona esta opción, deberá configurar el destino para esta ruta entrante como <b> Coincidir rango DID con rango de extensión </b> y configurar el DID y el rango de extensión. P.ej. si el rango DID es 5503301-5503305 y el rango de extensión es 1001-1005, las llamadas provenientes de DID 5503301 se enrutarán a 1001 y las llamadas provenientes de 5503302 se enrutarán a 1002. <br /> <br /> En los patrones DID, los siguientes caracteres tienen significados especiales: <br /> · X coincide con los números 0-9; <br /> · Z coincide con los números 1-9; <br /> · N coincide con los números 2-9; <br /> · [12345- 9] coincide con los números entre corchetes (en este ejemplo, 1, 2, 3, 4, 5, 6, 7, 8, 9); <br /> · Comodín \".\" coincide con uno o más números. P.ej. \"9011.\" coincide con cualquier cosa que comience con 9011 (excluyendo el propio 9011); <br /> · Comodín \"!\" coincide con ninguno o más de un número. P.ej. \"¡9011!\" coincide con cualquier cosa que comience con 9011 (incluido el propio 9011);",
