  "call_control.outbound_routes.available_time_detail": "Seleccione la condición de tiempo para permitir esta ruta de salida. Las opciones son: <br /> · Siempre: en cualquier momento, las extensiones permitidas pueden realizar llamadas salientes a través de esta ruta de salida. <br /> · Basado en el horario comercial global: controle la ruta según el horario comercial y los días festivos definidos en el <b > Control de llamadas> Horario comercial y festivos </b>. Puede configurar si desea permitir esta ruta en el horario comercial, fuera del horario comercial y en días festivos por separado. <br /> · Según el horario comercial personalizado: configure una regla exclusiva de horario comercial para esta ruta y controle en consecuencia. Puede configurar si desea permitir esta ruta en el horario comercial, fuera del horario comercial y en días festivos por separado. <br /> · Basado en períodos de tiempo personalizados: configure múltiples períodos de tiempo para permitir esta ruta. También puede configurar si desea permitir esta ruta en las vacaciones.",
