  "call_control.outbound_routes.dial_patterns": "Configuración de coincidencia de marcación",
  "call_control.outbound_routes.dial_patterns_detail": "Las llamadas salientes que coincidan con este patrón de marcación utilizarán esta ruta de salida. <br /> <br /> En los patrones, los siguientes caracteres tienen significados especiales: <br /> · X coincide con los números 0-9; <br /> · Z coincide con los números 1-9; <br /> · N coincide con los números 2- 9; <br /> · [12345-9] coincide con los números en el corchete (en este ejemplo, 1, 2, 3, 4, 5, 6, 7, 8, 9); <br /> · Comodín \".\" coincide con uno o más números. P.ej. \"9011.\" coincide con cualquier cosa que comience con 9011 (excluyendo el propio 9011); <br /> · Comodín \"!\" para extensiones SIP coincide con ninguno o más caracteres. P.ej. \"¡9011!\" coincide con cualquier extensión SIP que comience con 9011 (incluido el propio 9011); Para las extensiones FXS, se usa para marcación superpuesta. La PBX marcará una vez que el número esté completo y tan pronto como haya una coincidencia inequívoca. Por ejemplo, con \"9011!\", Cuando las extensiones FXS marcan 9011, el PBX marcará inmediatamente. <br /> <br /> Strip: Strip le permite especificar la cantidad de dígitos que se quitarán del frente del número de teléfono antes se realiza la llamada. Por ejemplo, si debe presionar 0 antes de marcar un número de teléfono, se debe quitar un dígito de la cadena de marcado antes de realizar la llamada. <br /> <br /> Anteponer: estos dígitos se antepondrán al número de teléfono antes de que se realice la llamada. metido. Por ejemplo, si una troncal requiere una marcación de 10 dígitos, pero los usuarios se sienten más cómodos con la marcación de 7 dígitos, este campo podría usarse para anteponer un código de área de 3 dígitos a todos los números de teléfono de 7 dígitos antes de realizar las llamadas.",
