  "call_features.queue.enb_announce_agent_id": "Anuncio de ID de agente",
  "call_features.queue.enb_announce_agent_id_detail": "Si está habilitado, se reproducirá un mensaje que contiene la identificación del agente a las personas que llamen cuando un agente les responda. Está deshabilitado de forma predeterminada.",
  "call_features.queue.enb_announce_hold_time": "Anunciar tiempo de espera",
  "call_features.queue.enb_announce_hold_time_detail": "Si está habilitado, el sistema anunciará el tiempo de espera estimado periódicamente a las personas que estén esperando. Está habilitado de forma predeterminada. Nota: si el tiempo de espera estimado es inferior a 1 minuto, ya no se anunciarán a las personas que llaman.",
  "call_features.queue.enb_announce_pos": "Anunciar posición",
  "call_features.queue.enb_announce_pos_detail": "Si está habilitado, el sistema anunciará periódicamente la cantidad de personas en espera. Está habilitado de forma predeterminada.",
  "call_features.queue.enb_email_abandon_call": "Notificar al administrador cuando se abandona una llamada en cola",
  "call_features.queue.enb_email_abandon_call_detail": "Si está habilitado, envíe un correo electrónico al administrador cuando una persona que llama en la cola abandona la llamada antes de que sea respondida. Está habilitado de forma predeterminada.",
  "call_features.queue.enb_email_miss_call": "Notificar al administrador cuando se pierda una llamada en cola",
  "call_features.queue.enb_email_miss_call_detail": "Si está habilitado, envíe un correo electrónico al administrador cuando se pierda una llamada en cola. Está habilitado de forma predeterminada. <br /> Una llamada en cola perdida significa que un agente no responde a la llamada. Por ejemplo, una llamada en cola puede conmutar por error al destino de la conmutación por error al alcanzar el tiempo de espera máximo, o la persona que llama puede presionar una tecla y ser enrutada a otro destino a través de un evento de pulsación de tecla antes de ser respondida, o la persona que llama puede ser redirigida a otro destino antes siendo respondido.",
  "call_features.queue.enb_email_sla_alarm": "Notificar al administrador cuando el SLA sea más bajo que su umbral de alarma",
  "call_features.queue.enb_email_sla_alarm_detail": "Si está habilitado, envíe un correo electrónico al administrador cuando se alcance el umbral de alarma de SLA de la cola. Está habilitado de forma predeterminada.",
