  "extension_trunk.trunks.diversion_user_part": "Diversion",
  "extension_trunk.trunks.diversion_user_part_detail": "Defina el valor en el campo de encabezado \"Diversion\" del paquete SIP INVITE para las llamadas salientes desde la troncal. Esta configuración requiere conocimientos profesionales del protocolo SIP, ya que las configuraciones incorrectas pueden causar problemas de llamadas. <br />\n<br />Opciones de configuración de troncales SIP Register:\n<br /> · [Predeterminado]: El orden de prioridad del valor será Caller ID de Ruta saliente → Caller ID saliente de la extensión → Caller ID saliente de la troncal → Nombre de usuario de la línea troncal → Caller ID de la extensión → Identificación del Caller ID originario.\n<br /> · [Ninguno]: No envía este parámetro con el paquete SIP INVITE.\n<br /> · Caller ID de ruta saliente: El Caller ID saliente configurado en <b> Control de llamadas> Rutas salientes </b>.\n<br /> · Caller ID saliente de la extensión: la extensión está asociada al Caller ID saliente con la troncal.\n<br /> · Caller ID saliente de la troncal: El Caller ID saliente configurado en <b> Extensiones/Troncales> Troncal> Identificador de llamadas salientes> General </b>.\n<br /> · Nombre de usuario de la troncal: el nombre de usuario de la troncal configurado en <b> Extensión / Troncal> Troncal> Autenticación </b>                                                                                        <br /> · Caller ID de extensión: el iCaller ID configurado en <b> Extensiones/ Troncales> Extensiones> Usuario> Información de extensión </b>, es el mismo que el número de extensión predeterminado. <br /> · Caller ID del originador: el número del Caller ID del autor de la llamada (el primer llamante en el caso de que se transfiera la llamada). Si el originador de la llamada es un número externo, se tomará el número externo. Si el originador de la llamada es una extensión, el orden de prioridad será El Caller ID saliente de la extensión → [Predeterminado].                                                                            <br /> · Personalizado: define un valor personalizado. <br />                                                                                                     <br />Opciones de configuración de Troncales Peer y Account                                                                         <br /> ·[Predeterminado]: El orden de prioridad será: Ruta de salida Caller ID saliente → Caller ID saliente de la extensión → Caller ID saliente de troncales → Caller ID de extensiones → Caller ID de origen.                                                                                                                                                                     <br /> · [Ninguno]: No envía este parámetro con el paquete SIP INVITE.                                                     <br /> · Caller ID de ruta saliente: El Caller ID saliente configurado en <b> Control de llamadas> Rutas salientes </b>.\n<br /> · Caller ID saliente de la extensión: la extensión está asociada al Caller ID saliente con la troncal.\n<br /> · Caller ID saliente de la troncal: El Caller ID saliente configurado en <b> Extensiones/Troncales> Troncal> Identificador de llamadas salientes> General </b>.                                                                                      <br /> · Caller ID de extensión: el iCaller ID configurado en <b> Extensiones/ Troncales> Extensiones> Usuario> Información de extensión </b>, es el mismo que el número de extensión predeterminado. <br /> · Caller ID del originador: el número del Caller ID del autor de la llamada (el primer llamante en el caso de que se transfiera la llamada). Si el originador de la llamada es un número externo, se tomará el número externo. Si el originador de la llamada es una extensión, el orden de prioridad será El Caller ID saliente de la extensión → [Predeterminado].                                                                            <br /> · Personalizado: define un valor personalizado. <br />                   ",
