  "extension_trunk.trunks.dtmf_mode_detail": "Establezca el modo de envío de los tonos DTMF. Las opciones son:<br />- RFC4733 (RFC2833): DTMF será transportado en el flujo RTP en paquetes RTP diferentes a la señal de audio. <br />- Info: DTMF será transportado en los mensajes de información SIP. <br />- En la banda: DTMF será transportado en la señal de audio. <br />- Auto: La PBX detectará si el dispositivo soporta RFC4733 (RFC2833) DTMF. Si el RFC4733 (RFC2833) está soportado, elegirá RFC4733 (RFC2833); de lo contrario, elegirá Inband. <br />El modo por defecto es RFC4733 (RFC2833).",
