  "extension_trunk.trunks.from_disp_name_part": "De la parte del nombre de la pantalla",
  "extension_trunk.trunks.from_disp_name_part_detail": "Todas las llamadas salientes de este Tronco SIP usarán el nombre que aparece en el encabezado del paquete de invitación SIP. <br />- [Predeterminado]: muestra el nombre correspondiente al identificador de llamadas salientes cuando son realmente salientes;<br />- Nombre del identificador de llamadas de la extensión: Este nombre de identificación de llamadas está compuesto por la combinación de \"\"Apellido\"\" y \"\"Nombre\"\" de acuerdo con el \"Formato de visualización del nombre de preferencia\";<br />- Nombre de identificación de llamadas salientes por defecto de la troncal: el nombre de identificación de llamadas salientes por defecto de la troncal;<br />- Nombre de identificación de llamadas salientes de la extensión en la troncal: el Nombre del Identificador de Llamadas Salientes configurado para asociarse con la Extensión en la Troncal;<br />- Nombre del Identificador de Llamadas del Origen: el Número del Identificador de Llamadas del primer llamante en el caso de que la llamada sea transferida y el Nombre del Identificador de Llamadas dependa de [Dafault] al hacer una llamada directa;<br />- Personalizado: el valor del personalizado del administrador configurado.",
  "extension_trunk.trunks.from_host_part": "Desde la parte del host",
  "extension_trunk.trunks.from_user_part": "De la parte del usuario",
  "extension_trunk.trunks.from_user_part_detail": "Defina el valor en el campo de la cabecera From del paquete SIP INVITE para las llamadas salientes de este tronco. Esta configuración requiere un conocimiento profesional del protocolo SIP, ya que las configuraciones incorrectas pueden causar problemas en las llamadas. <br />\n<br />SIP Register Trunk Setting Options:\n<br />- [Predeterminado]: el orden de prioridad será Ruta de salida Identificación de llamadas salientes → Extensión Identificación de llamadas salientes → Troncal Identificación de llamadas salientes → Nombre de usuario de la troncal → Extensión Identificación de llamadas → La identificación de llamadas del originador.\n<br />- Ruta Saliente Identificación de Llamadas Salientes: la identificación de llamadas salientes configurada en <b>Control de Llamadas > Ruta Saliente</b>.\n<br />- Identificación de Llamadas Salientes de la extensión: la identificación de llamadas salientes de la extensión asociada a la troncal.\n<br />- Troncal de Identificación de Llamadas Salientes: la Identificación de Llamadas Salientes configurada en <b>Extensión/Troncal > Troncal > Identificación de Llamadas Salientes > General</b>.\n<br />- Trunk Username: el nombre de usuario de la troncal configurado en <b>Extension/Trunk > Trunk > Username</b>\n<br />- Identificador de llamadas de la extensión: el identificador de llamadas configurado en el <b> Extensión/Tronco > Extensión > Usuario > Información de la extensión</b>, que es el mismo que el número de la extensión por defecto. \n<br />- Identificación de Llamada del Originador: el número de identificación de llamada del originador de la llamada (el primer llamante en el caso de que la llamada sea transferida). Si el originador de la llamada es un número externo, se tomará el número externo. Si el originador de la llamada es una extensión, el orden de prioridad será el ID de la llamada saliente de la extensión → [Predeterminado]. \n<br />- Personalizado: definir un valor personalizado.<br />\n\n<br />SIP Peer Trunk y SIP Account Trunk Setting Options:\n<br />- [Predeterminado]: el orden de prioridad será Ruta de salida Identificación de llamadas salientes → Extensión Identificación de llamadas salientes → Troncal Identificación de llamadas salientes → Extensión Identificación de llamadas → Identificación de llamadas del originador.\n<br />- Ruta Saliente Identificación de Llamadas Salientes: la identificación de llamadas salientes configurada en <b>Control de Llamadas > Ruta Saliente</b>.\n<br />- Identificación de Llamadas Salientes de la extensión: la identificación de llamadas salientes de la extensión asociada a la troncal.\n<br />- Troncal de Identificación de Llamadas Salientes: la Identificación de Llamadas Salientes configurada en <b>Extensión/Troncal > Troncal > Identificación de Llamadas Salientes > General</b>.\n<br />- Extensión de Identificación de Llamadas: la identificación de llamadas configurada en <b>Extensión/Troncal > Extensión > Usuario > Información de la extensión</b>, que es la misma que el número de la extensión por defecto. \n<br />- Caller ID del originador: el número de identificación de llamada del originador de la llamada (el primer llamante en el caso de que la llamada sea transferida). Si el originador de la llamada es un número externo, se tomará el número externo. Si el originador de la llamada es una extensión, el orden de prioridad será el ID de la llamada saliente de la extensión → [Predeterminado]. \n<br />- Personalizado: definir un valor personalizado.<br />",
