  "extension_trunk.trunks.outbound_cid_start": "Número de inicio del identificador de llamadas salientes",
  "extension_trunk.trunks.outbound_cid_type": "Crear el método",
  "extension_trunk.trunks.outbound_cid_type_detail": "Las opciones son:\n<br /> - Identificador de llamadas salientes compartido: asociar un identificador de llamadas salientes con una o varias extensiones o grupos de extensiones. Cuando se configura con éxito, las extensiones asociadas usarán el identificador de llamadas salientes compartido cuando llamen desde esta troncal.\n<br /> - Identificador de Llamadas Salientes emparejado con la extensión: utilice el comodín {{.Ext}} para hacer coincidir el número de extensión en el identificador de llamadas salientes. Por ejemplo, establezca el patrón de identificación de llamadas salientes como 592550{{.Ext}} y seleccione las extensiones 1000 y 9001 para asociarlas, entonces cuando llame desde esta troncal, el identificador de llamadas salientes será 5925501000 para la extensión 1000 y 5925509001 para la extensión 9001.\n<br /> - Rango del identificador de llamadas salientes: vincular los identificadores de llamadas salientes consecutivos a las extensiones consecutivas con correspondencia uno a uno. Por ejemplo, establezca el rango del identificador de llamadas salientes como 5925503001-5925503005 y el rango de la extensión como 1011-1015, entonces al llamar desde esta troncal, el identificador de llamadas salientes será 5925503001 para la extensión 1011, 5925503002 para la extensión 1012, y así sucesivamente.",
  "extension_trunk.trunks.outbound_parameters": "Parámetros de salida",
