  "extension_trunk.trunks.patterns": "Patrones",
  "extension_trunk.trunks.patterns_detail": "El identificador de llamadas entrantes que coincide con el patrón de adaptación se adaptará, de modo que puede pulsar el registro de llamadas directamente en su teléfono para devolver la llamada a un número.<br />En el patrón de adaptación, los siguientes caracteres tienen un significado especial:<br />X coincide con los números 0-9;<br />Z coincide con los números 1-9;\n<br />N coincide con los números 2-9;<br />[12345-9] coincide con los números entre paréntesis (en este ejemplo, 1, 2, 3, 4, 5, 6, 7, 8, 9);<br />Wildcard &#34;.&#34; coincide con uno o más números. Por ejemplo &#34;9011.&#34; coincide con cualquier cosa que comience con 9011 (excluyendo el propio 9011);<br />Wildcard &#34;!&#34; coincide con ninguno o más de un número. Por ejemplo &#34;9011!&#34; coincide con cualquier cosa que empiece por 9011 (incluyendo el propio 9011).",
